import React from "react";
import location from "../Assets/adv-aseets/icons/icon-1.png";
import email from "../Assets/adv-aseets/icons/icon-2.png";
import tel from "../Assets/adv-aseets/icons/icon-3.png";
import insta0 from "../Assets/adv-aseets/insta/li-0.png";
import insta1 from "../Assets/adv-aseets/insta/li-1.png";
import insta2 from "../Assets/adv-aseets/insta/li-2.png";
import { Link } from "react-router-dom";
export default function Footer() {
  return (
    <div className="page-footer d-flex">
      <div className="w-25">
        <h1>TEKNOLOJİK YEMEKLER</h1>
        <img src={location} />
        <p>341 Londonderry Road,</p>
        <p>İstanbul, Türkiye</p>
        <img src={email} />
        <p>aciktim@teknolojikyemekler.com</p>
        <img src={tel} />
        <p>+90 216 123 45 67</p>
      </div>
      <div>
        <h4 className="py-5">Sıcacık Menüler</h4>
        <p>Terminal Pizza</p>
        <p>5 Kişilik Hackathlon Pizza</p>
        <p>UseEffect Tavuklu Pizza</p>
        <p>Beyaz Console Frosty</p>
        <p>Testler Geçti Mutlu burger</p>
        <p>Position Absolute Acı Burger</p>
      </div>
      <div>
        <a href="https://www.instagram.com/fast_food_yemekler/" target="blank">
          Instagram
          <img src={insta0}></img>
          <img src={insta1}></img>
          <img src={insta2}></img>
        </a>
      </div>
    </div>
  );
}
